export default {
    checkAuth: function(){
		return fetch("/auth", {
      method: 'GET',
      credentials: 'include',
      mode: 'cors'
    });
    },
    handleSignUp:  function (userData) {
        return fetch ("/signup", {
            method:"POST",
            header:{
                "Content-Type": "application/json; charset=utf-8"
            },
            body:JSON.stringify(userData),
            credentials:'include',
            mode:"cors"
        });
    }
}
